package com.example.smallwhite.designpatterns.proxy.V2;/** * @author: yangqiang * @create: 2021-02-25 22:05 */public class TimeProxy implements MoveAble {    MoveAble moveAble;    public TimeProxy(MoveAble moveAble) {        this.moveAble = moveAble;    }    @Override    public void move() {        long start = System.currentTimeMillis();        moveAble.move();        long end = System.currentTimeMillis();        System.out.println("tank跑了"+(end-start)+" ms");    }}